import React, { useState } from 'react';
import {
  Menu,
  Home,
  Package,
  PieChart,
  Table,
  LayoutDashboard,
} from '@lucide/react';

const Navbar = () => {
  const [activeItem, setActiveItem] = useState('Dashboard');

  const items = [
    { name: 'Dashboard', icon: LayoutDashboard, link: '/' },
    { name: 'Components', icon: Package, link: '/components' },
    { name: 'Utilities', icon: Menu, link: '/utilities' },
    { name: 'Pages', icon: Home, link: '/pages' },
    { name: 'Charts', icon: PieChart, link: '/charts' },
    { name: 'Tables', icon: Table, link: '/tables' },
  ];

  return (
    <aside className="bg-gray-800 text-white w-64 h-screen fixed">
      {/* Navbar Header */}
      <div className="p-4 flex items-center justify-center">
        <span className="text-xl font-semibold">SB Admin 2</span>
      </div>

      {/* Navbar Items */}
      <ul className="mt-4">
        {items.map((item) => (
          <li
            key={item.name}
            className={`flex items-center p-2 rounded hover:bg-gray-700 cursor-pointer ${
              activeItem === item.name ? 'bg-gray-700' : ''
            }`}
            onClick={() => setActiveItem(item.name)}
          >
            <item.icon className="w-5 h-5 mr-2" />
            <span>{item.name}</span>
          </li>
        ))}
      </ul>
    </aside>
  );
};

export default Navbar;
